-- ----------------------------
-- View structure for v_clientdev
-- ----------------------------
DROP VIEW IF EXISTS `v_clientdev`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_clientdev` AS select `product`.`id` AS `id`,`product`.`barcode` AS `barcode`,`model`.`code` AS `code`,`model`.`description` AS `description`,`detail`.`state` AS `state`,`voucher`.`date` AS `date`,`client`.`name` AS `name`,`client`.`id` AS `idclient`,`detail`.`observation` AS `observation`,`voucher`.`id` AS `idvoucher` from ((((`product` join `model` on((`product`.`variant` = `model`.`id`))) join `detail` on((`detail`.`product` = `product`.`id`))) join `voucher` on((`detail`.`voucher` = `voucher`.`id`))) join `client` on((`voucher`.`client` = `client`.`id`))) where (`detail`.`state` = 0) ;

-- ----------------------------
-- View structure for v_createbarcode
-- ----------------------------
DROP VIEW IF EXISTS `v_createbarcode`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_createbarcode` AS select concat('CIN-',year(now()),'-',week(now(),0),'-','00',((select `aux`.`id` from `aux` order by `aux`.`id` desc limit 1) + 1)) AS `barcode` ;

-- ----------------------------
-- View structure for v_detail
-- ----------------------------
DROP VIEW IF EXISTS `v_detail`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_detail` AS select `client`.`name` AS `name`,`product`.`barcode` AS `barcode`,`model`.`description` AS `description`,`model`.`code` AS `code`,`detail`.`voucher` AS `voucher`,`detail`.`id` AS `id`,`product`.`id` AS `idproduct`,(select count(`detail`.`id`) from `detail` where (`model`.`code` = `model`.`code`)) AS `count`,`detail`.`observation` AS `observation`,`client`.`id` AS `idclient`,`detail`.`state` AS `state` from ((((`detail` join `voucher` on((`detail`.`voucher` = `voucher`.`id`))) join `client` on((`voucher`.`client` = `client`.`id`))) join `product` on((`detail`.`product` = `product`.`id`))) join `model` on((`product`.`variant` = `model`.`id`))) ;

-- ----------------------------
-- View structure for v_devolution
-- ----------------------------
DROP VIEW IF EXISTS `v_devolution`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_devolution` AS SELECT
devolution.id AS id,
devolution.date AS date,
devolution.reference AS reference,
devolution.type AS type,
devolution.state AS state,
client.`name` AS `name`,
client.address AS address,
client.phone AS phone,
client.email AS email,
`user`.id AS iduser,
concat(
		`user`.`name`,
		' ',
		`user`.`lastname`
	) AS `user`,
client.id as idclient
FROM
	(
		(
			`devolution`
			JOIN `client` ON (
				(
					`devolution`.`client` = `client`.`id`
				)
			)
		)
		JOIN `user` ON (
			(
				`devolution`.`user` = `user`.`id`
			)
		)
	) ;

